      SELECT DISTINCT - col2 + col2 * - tab0.col2 FROM tab0 (FORMAT parquet) WHERE - col2 * col2 / - col0 - col1 * col0 NOT BETWEEN NULL AND ( + col0 );
  - name: tab0

outputs:
  - name: q774.out
    data: |
